import React from "react";
import './homepage.css';

const Homepage = () => {
  return (
    <div className="homepage">
      <div className="gif-sticker">
        <img src="https://media.giphy.com/media/d3mlE7uhX8KFgEmY/giphy.gif" alt="tech gif" />
      </div>
      <div className="container">
        <h1 className="title">Welcome to My Page...</h1>
        <p className="intro">I am Venkatesh, a passionate technologist with a vision for the cloud.</p>
        <p className="goal">My Goal <br /> Throughout my journey in the cloud, my goal has been to</p>
        <h2 className="motto">"Dream it, Build it, Deploy it"</h2>
        <a href="/resume" className="resume-btn">View My Resume</a>
      </div>
    </div>
  );
};

export default Homepage;
